Un îlot est un ensemble de parcelles culturales:- contiguës, entières ou partielles, portant une ou plusieurs cultures, exploitées par le déclarant;
- limité par des éléments facilement repérables et permanents, comme un chemin, une route, un ruisseau.. ou par d'autres exploitations;
- stable d'une année sur l'autre.
L'ensemble des îlots de l'exploitation doit contenir toutes les surfaces concernées par des mesures d'aide (paiement à la surface, surfaces fourragères pour les aides bovines, mesures agro-environnementales, mesures de protection de l'environnement, boisement des terres agricoles, indemnités compensatoires de handicap naturel, contrats territoriaux d'exploitation, contrats d'agriculture durable, tabac, houblon, tomates et agrumes transformées, fruits à coque, pommes de terre féculiére, cultures énergétiques..).Le registre parcellaire aaaa. est l'ensemble des îlots déclarés par un exploitant pour la campagne de l'année aaaa. Depuis 2004 il est graphique sur l'ensemble du territoire (sauf Guyane et Guadeloupe) = Registre Parcellaire Graphique (RPG) = îlots dessinés sur fond d'orthophotoplan.
Registre Parcellaire Graphique (RPG) anonymisé, c'est à dire ne comprenant pas les données personnelles (numéro PACAGE) des agriculteurs déclarants bénéficiaires d'aides directes dans le cadre de la Politique Agricole Commune (PAC). Le RPG est en effet constitué, chaque année depuis 2004, de l'ensemble des îlots culturaux géolocalisés par les déclarants eux-mêmes (sur fond ortho-photographique fourni) lors de la campagne annuelle de "déclarations PAC" lancée chaque printemps sur l'ensemble du territoire français (hors Guyane et Guadeloupe). Leur tracé sert de base légale à l'Agence de Services et de Paiement (ASP) pour déterminer le montant de diverses aides directes aux agriculteurs et leur surface (saisie au moyen du logiciel ISIS mis à disposition par l'ASP) est contrôlée, par sondage orienté, dans le courant de l'été suivant les déclarations.La population retenue pour l'extraction depuis l'extracteur ISIS est celle des déclarants de surfaces dont le RPG est complètement saisi.
